import { Card } from "@chakra-ui/react";

const FaqCard = () => {
  return (
    <Card
      style={{
        width: "50%",
        height: "60vh",
        marginTop: "-10%",
        borderRadius: "16px",
        boxShadow:
          "0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)",
      }}
    ></Card>
  );
};

export default FaqCard;
